
-- Database with apple Stocks prices for last 10 years

CREATE DATABASE Apple_stocks_price;
USE Apple_stocks_price;


CREATE TABLE stock_prices (
    Date DATE NOT NULL,
    Open DECIMAL(10, 2),
    High DECIMAL(10, 2),
    Low DECIMAL(10, 2),
    Close DECIMAL(10, 2),
    Volume BIGINT,
    PRIMARY KEY (Date)
);


select * from stock_prices;

